import Modal from "../UI/Modal";
import Class from "./Thanks.module.css";

const ThankYou = (props) => {
  return (
    <Modal onClose={props.onClose}>
      <div class={Cl}>
        <div class="thank-you">
          <span class="text">Thank You!</span>
          <span class="emoji">&#x1F389;</span>
        </div>
      </div>
    </Modal>
  );
};

export default ThankYou;
